import React from "react";
import "./style.css";
import map from "../../images/world_map-1.png";

function WorldMap(props) {
  console.log(map);
  return (
    <div className="image-container">
      <img className="worldMap" src={map}>
        <span class="dot" />
        <span class="dot" />
        <span class="dot" />
        <span class="dot" />
        <span class="dot" />
        <span class="dot" />
      </img>
    </div>
  );
}

export default WorldMap;
